import React from 'react';
import logo from './logo.svg';
import './App.css';

function Hero() {
  return (
    <div className="App">
      <header className="App-header">
        <h1 class="overlay">
          Alex Graham
        </h1>
        <p>
          IT Contractor and Website Builder
        </p>
      </header>
    </div>
  );
}

export default Hero;
